      SELECT DISTINCT + ( + cor0.col2 ) * + col2 + ( ( + col1 ) ) + + ( - col1 + - col1 * - cor0.col0 ) AS col0 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
